    geo_json_e8c9078c09e2c9064845a68d1b78a0ea.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["GridID", "count_all"];
    let aliases = ["GridID", "All (Nights 1 to 3)"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

    }

    return div
    }
